#define likely(x)       __builtin_expect((x),1)
#define unlikely(x)     __builtin_expect((x),0)
#define num_to_bit(x) (0x10000000000000ul<<((x-(x>>2<<2))*3)) | (1ul<<(x>>2<<2));
#define shift_long(x) (((((x>>31)+x)>>14)+((x>>31)+x)) & 0x0000000000007ffful);

inline unsigned int card_to_num(const char card[]){
  unsigned int rank, suit;
  switch(card[0]) {
    case 'A': rank = 12; break;
    case 'K': rank = 11; break;
    case 'Q': rank = 10; break;
    case 'J': rank = 9; break;
    case 'T': rank = 8; break;
    default: rank = card[0] - 2 - '0'; break;
  }
  switch(card[1]) {
    case 's': suit = 0; break;
    case 'h': suit = 1; break;
    case 'd': suit = 2; break;
    case 'c': suit = 3; break;
  }
  return rank * 4 + suit;
}

inline uint64_t card_to_bit(const char card[]) {
  uint64_t rank, suit;
  switch (card[0]) {
    case 'A': rank = 0x1000000000000; break;
    case 'K': rank = 0x100000000000; break;
    case 'Q': rank = 0x10000000000; break;
    case 'J': rank = 0x1000000000; break;
    case 'T': rank = 0x100000000; break;
    default: rank = 1u << ((card[0] - 2)*4); break;
  }
  switch (card[1]) {
    case 's': suit = 0x10000000000000; break;
    case 'h': suit = 0x80000000000000; break;
    case 'd': suit = 0x400000000000000; break;
    case 'c': suit = 0x2000000000000000; break;
  }
  return rank + suit;
}

inline char* num_to_card(unsigned int x) {
  unsigned int rank = x >> 2;
  unsigned int suit = 52 - rank << 2;
  char rank_, suit_;
  switch (rank) {
    case 12: rank_ = 'A'; break;
    case 11: rank_ = 'K'; break;
    case 10: rank_ = 'Q'; break;
    case 9: rank_ = 'J'; break;
    case 8: rank_ = 'T'; break;
    default: rank_ = '0' + 2 + rank; break;
  }
  switch (suit) {
    case 0: suit_ = 's'; break;
    case 1: suit_ = 'h'; break;
    case 2: suit_ = 'd'; break;
    case 3: suit_ = 'c'; break; 
  }
  static char card[3];
  card[0] = rank_;
  card[1] = suit_;
  card[2] = '\0';
  return card;
}

